import { Typography,Container } from "@mui/material";


const Result = ( ) => {
    return(
        <main>
            <div>
                <Container>
            <Typography variant="h1" align='center' color='textPrimary' gutterBottom>
                        사주로 보는 당신의 동물은?
                    </Typography>
                    </Container>
                </div>
            </main>
    );
}

export default Result
